import React from 'react';
import './App.css';
import Header from './components/Layout/Header';
import MealsSummary from './components/Meals/MealSummary';
import Meals from './components/Meals/Meals';


function App() {
  return (
   <React.Fragment>
    <Header/>
    <main>
      <MealsSummary/>
      <Meals/>
    </main>

   </React.Fragment>
  );
}

export default App;
